  `deleted` enum('Y','N') NOT NULL DEFAULT 'N',
  PRIMARY KEY (`store_no`),
  UNIQUE KEY `address` (`address`),
  UNIQUE KEY `unique_location` (`location_x`,`location_y`),
  KEY `FK_users_TO_store_1` (`user_no`),
